const { render } = require("ejs");
const express = require("express");
const bodyParser = require('body-parser');
const path = require("path");
const app = express();
// Middleware to parse JSON and form data
app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }));

app.set("views",path.resolve(__dirname,"views"));
app.set("view engine","ejs");

app.get('/',(req,res)=>{
    var name = 'swaroop';
    res.render('index', { name });
});

app.get('/find',(req,res)=>{
    const jsonData = [
        {
          title: 'Biryani',
          image: 'data:image/jpeg;base64,',
          location: 'Near Shanivar Wada',
          description: 'Biryani on ocassion of Chicken Fest',
        },
        {
          title: 'Puri Sabji',
          image: 'data:image/jpeg;base64,',
          location: 'Kasba Ganpati',
          description: 'Puri Sabji on occasion of Ganesh Jayanti.',
        },
        {
          title: 'Veg Thali',
          image: 'data:image/jpeg;base64,',
          location: "Near Nana Wada",
          description: 'Veg Thali on occasion of Navratri',
        },

      ];
      
    res.render('find', { cards: jsonData });
});
app.get('/share',(req,res)=>{
    res.render('share');
});
app.post('/share',(req,res)=>{
    const formData = req.body;
    console.log('Form Data:', formData);
    res.json(formData);
});
app.get('/farmers',(req,res)=>{
    res.render('farmers');
});

app.use((req,res)=>{
    res.status(404).send("Oops! The requested page was not found")
});
app.listen(8080, ()=>{
    console.log('Server listening on port 8080...')
});